(@last_percobaan_id, 1122, 5451, NULL, 0, NOW(), NOW()),
(@last_percobaan_id, 1123, 5455, NULL, 0, NOW(), NOW()),
(@last_percobaan_id, 1124, NULL, 'Saya sangat terkesan dengan lingkungan UPT yang menyediakan fasilitas dengan super lengkap. Siswa-siswi tidak perlu khawatir mengenai tempat tinggal dan makan sehari-hari, jadi hanya perlu fokus belajar. Pesan saya, tetap terus dilanjutkan kegiatan seperti ini, karena sangat berguna bagi murid SMK untuk meningkatkan skillnya, baik itu soft skill maupun hard skill.', 0, NOW(), NOW()),
(@last_percobaan_id, 1125, 5459, NULL, 0, NOW(), NOW()),
(@last_percobaan_id, 1126, 5463, NULL, 0, NOW(), NOW()),
(@last_percobaan_id, 1127, 5467, NULL, 0, NOW(), NOW()),
(@last_percobaan_id, 1128, 5471, NULL, 0, NOW(), NOW()),
(@last_percobaan_id, 1129, 5475, NULL, 0, NOW(), NOW()),
(@last_percobaan_id, 1130, 5479, NULL, 0, NOW(), NOW()),
(@last_percobaan_id, 1131, 5483, NULL, 0, NOW(), NOW()),
(@last_percobaan_id, 1132, 5487, NULL, 0, NOW(), NOW()),
(@last_percobaan_id, 1133, 5488, NULL, 0, NOW(), NOW()),
(@last_percobaan_id, 1134, 5495, NULL, 0, NOW(), NOW()),
(@last_percobaan_id, 1135, NULL, 'Materi yang diberikan sudah sesuai dengan kebutuhan kerja di masa depan. Untuk waktu, saya sedikit kecewa di hari Rabu, karena di jadwal seharusnya materi pembentukan karakter selesai di pukul 10.00, namun baru selesai sekitar pukul 11.30 yang dimana itu lumayan menganggu karena waktu sebanyak itu bisa dipergunakan untuk latihan persiapan uji kompetensi. Di lab web desain sudah cukup mumpuni untuk praktik, tetapi sinyal jaringan sedikit lemot sehingga perlu sedikit kesabaran karena menunggu loading.', 0, NOW(), NOW()),
(@last_percobaan_id, 1136, 5499, NULL, 0, NOW(), NOW()),
(@last_percobaan_id, 1137, 5503, NULL, 0, NOW(), NOW()),
(@last_percobaan_id, 1138, 5507, NULL, 0, NOW(), NOW()),
(@last_percobaan_id, 1139, 5511, NULL, 0, NOW(), NOW()),
(@last_percobaan_id, 1140, 5515, NULL, 0, NOW(), NOW()),
(@last_percobaan_id, 1141, 5519, NULL, 0, NOW(), NOW()),
(@last_percobaan_id, 1142, 5523, NULL, 0, NOW(), NOW()),
(@last_percobaan_id, 1143, 5527, NULL, 0, NOW(), NOW()),
(@last_percobaan_id, 1144, NULL, 'Saya terkesan dengan Mas Agus, selain memberikan materi kompetensi, beliau juga memberikan materi bagaimana cara menjalani kehidupan di dunia kerja. Sayaa juga berterima kasih kepada Mas Agus yang telah membantu saya di menit-menit terakhir uji kompetensi karena adanya kesalahan di web yang saya buat. Terima kasih banyak, Mas Agus', 0, NOW(), NOW());
